import React from "react";

let listOfImages = [];
const Gallery = () => {
  const importAll = (r) => {
    return r.keys().map(r);
  };

  listOfImages = importAll(
    require.context("../../Images/Yoga/", false, /\.(png|jpe?g|svg)$/)
  );

  return (
    <>
      <h1>Photo Gallery coming soon!</h1>
      <div>
        {listOfImages.map((image, index) => (
          <img key={index} src={image.default} alt={image.default}></img>
        ))}
      </div>
    </>
  );
};

export default Gallery;
